import React from 'react';
import TextField from '@material-ui/core/TextField';

const styles = theme => ({
    multilineColor:{
        color:'red'
    },
    label: {
        fontSize: '10px',
        color: '#c1c1c2',
        '&:focus':{
            fontSize: '10px',
            color: '#c1c1c2',
        }
    },
});
        class Login extends React.Component{
            constructor(props){
                super(props);
                this.state={
                    user:{}
                }
            }
            render() {
                const classes=styles();
             return(

                    <TextField
                       id="outlined-email-input"
                        label="Email"
                       InputProps={{
                           classes: {
                               input: classes.label
                           }
                       }}
                        type="email"
                        name="email"
                        autoComplete="email"
                        margin="normal"
                        variant="outlined"

                    />
                )
            }

        }


export default Login;
